import React, { Component } from 'react'

export default class Child extends Component {
  render(props) {
    return (
      <div>
        console.log(props)
        <p>Name:{this.props.name}</p>
        <p>Age:{this.props.age}</p>
        <p>This is props</p>
      </div>
    )
  }
}
